import React, { useContext, useState, useSyncExternalStore } from "react";
import { Text, View, StyleSheet, Image, ScrollView, TouchableOpacity } from "react-native"
import colors from "../../constant/colors";
import {
    useFonts,
    Poppins_100Thin,
    Poppins_100Thin_Italic,
    Poppins_200ExtraLight,
    Poppins_200ExtraLight_Italic,
    Poppins_300Light,
    Poppins_300Light_Italic,
    Poppins_400Regular,
    Poppins_400Regular_Italic,
    Poppins_500Medium,
    Poppins_500Medium_Italic,
    Poppins_600SemiBold,
    Poppins_600SemiBold_Italic,
    Poppins_700Bold,
    Poppins_700Bold_Italic,
    Poppins_800ExtraBold,
    Poppins_800ExtraBold_Italic,
    Poppins_900Black,
    Poppins_900Black_Italic,
} from '@expo-google-fonts/poppins';
import { Entypo } from '@expo/vector-icons';
import AppLoading from "expo-app-loading";
import Header from "../../components/header/Header";
import YellowBtn from "../../components/button/YellowBtn";
import Card from "../../components/card/Card";
import { useNavigation } from "@react-navigation/native";
import { AuthContext } from '../../Context/Auth'
import axios from "axios";



const data = [
    {
        image: 'https://static1.makeuseofimages.com/wordpress/wp-content/uploads/2016/10/camera-photo-lens-stock-images.jpg?q=50&fit=contain&w=1500&h=750&dpr=1.5',
        count: 1,
        users: '+2',
        teamname: 'Group',
        duedate: '12/aug/20',
        text: 'Details will be mentioned here, user will be able to see the additional information upon click...',
    },
    {
        image: 'https://images.unsplash.com/photo-1535890696255-dd5bcd79e6df?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxleHBsb3JlLWZlZWR8MXx8fGVufDB8fHx8&w=1000&q=80',
        count: 4,
        users: '+7',
        teamname: 'Group',
        duedate: 'Due Date',
        text: 'Details will be mentioned here, user will be able to see the additional information upon click...',
    },

]

const Groups = (props) => {
    const { user , setCurrentNewWorkspace } = useContext(AuthContext)
    const navigation = useNavigation()
    let [fontsLoaded] = useFonts({
        Poppins_100Thin,
        Poppins_100Thin_Italic,
        Poppins_200ExtraLight,
        Poppins_200ExtraLight_Italic,
        Poppins_300Light,
        Poppins_300Light_Italic,
        Poppins_400Regular,
        Poppins_400Regular_Italic,
        Poppins_500Medium,
        Poppins_500Medium_Italic,
        Poppins_600SemiBold,
        Poppins_600SemiBold_Italic,
        Poppins_700Bold,
        Poppins_700Bold_Italic,
        Poppins_800ExtraBold,
        Poppins_800ExtraBold_Italic,
        Poppins_900Black,
        Poppins_900Black_Italic,
    });



    const requestAcceptByMe = (userId, workspaceId) => {
        const form = {
            userId: userId,
            workSpaceId: workspaceId,
        }
        axios.post('http://192.168.0.106:5000/workspace/request-accept-byUser', form)
            .then(function (response) {
                alert("Request Accepted")
            })
            .catch(function (error) {
                console.log(error);
            });

    }


    const add = (userId, workspaceId) => {
        const form = {
            userId: userId,
            workspaceId: workspaceId,
        }
        axios.post('http://192.168.0.106:5000/workspace/request-by-user', form)
            .then(function (response) {
                alert("Request Sent")
            })
            .catch(function (error) {
                console.log(error);
            });
    }

    return !fontsLoaded ? <AppLoading /> : (
        <ScrollView style={styles.Mainview}>
            <View>
                {props.data.map((item, index) => {
                    var requestFromMeAsk;
                    var requestFromAdminAsk;
                    for (var i = 0; i < item.requestedUsers.length; i++) {
                        if (item.requestedUsers[i] === user._id) {
                            requestFromAdminAsk = true;
                            break;
                        }

                    }
                    for (var j = 0; j < item.userRequests.length; j++) {
                        if (item.userRequests[j] === user._id) {
                            requestFromMeAsk = true;
                            break;
                        }

                    }
                    return (
                        <TouchableOpacity activeOpacity={0.9} onPress={() => {
                            navigation.navigate('postview')
                            setCurrentNewWorkspace(item)
                            }}>
                            <Card
                                image={item?.workSpaceImage ? item.workSpaceImage : "https://images.unsplash.com/photo-1535890696255-dd5bcd79e6df?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxleHBsb3JlLWZlZWR8MXx8fGVufDB8fHx8&w=1000&q=80"}
                                count={item.count}
                                users={item.users.length > 9 ? "9+" : item.users.length}
                                teamname={item.workSpaceName}
                                duedate={item.duedate}
                                text={item.about}
                                title={requestFromAdminAsk ? "Accept" : requestFromMeAsk ? "Reuqested" : "Join"}
                                onClick={() => requestFromAdminAsk ? requestAcceptByMe(user._id , item._id) : requestFromMeAsk ? null : add(user._id , item._id)}
                            />
                        </TouchableOpacity>

                    )
                })}
            </View>

        </ScrollView>
    )
}

export default Groups;

const styles = StyleSheet.create({
    Mainview: { flex: 1, backgroundColor: '#fff' },
    headingStyle: { fontSize: 20, color: 'black', fontFamily: 'Poppins_700Bold' },
    title: { fontSize: 14, marginBottom: 30, fontFamily: 'Poppins_700Bold', color: 'black' },
    declineStyle: { marginLeft: 10, backgroundColor: '#fff', borderWidth: 1, borderColor: colors.blue }


})
